window.bookSummaryJSON = "<p>How hard do you have to shake the family tree to find the truth about the past? </p> <p>Fifteen-year-old Rae Kerrigan never really knew her family's history. Her mother and father died when she was young and it is only when she accepts a scholarship to the prestigious Guilder Boarding School in England that a mysterious family secret is revealed. </p> <p>Will the sins of the father be the sins of the daughter? </p> <p>As Rae struggles with new friends, a new school and a star-struck forbidden love, she must also face the ultimate challenge: receive a tattoo on her 16th birthday with specific powers that may bind her to an unspeakable darkness. It's up to Rae to undo the dark evil in her family's past and have a ray of hope for her future. </p>"; 
